INSERT INTO `goods_comment` VALUES (7,4,'终于换上心心念的洗烘一体的啦，非常完美，阴天再也不怕衣服没太阳了，小朋友的衣服都可以烘干一下，洗衣服的时候也没有噪音，很喜欢，遇到国补，非常划算','https://misc.360buyimg.com/user/myjd-2015/css/i/peisong.jpg','j***e'),(8,4,'🏡 第一台洗洪套装的洗衣机干衣机，颜值和性能都非常在线！洗烘一体真的太方便了，再也不用担心阴雨天气🌧️。安装到位，物流超快，满意。','https://misc.360buyimg.com/user/myjd-2015/css/i/peisong.jpg','j***红'),(9,4,'使用这款小天鹅洗衣机的体验非常愉快。首先，它的外观设计简洁大方，操作界面直观易用。在使用过程中，洗衣机的噪音控制得非常好，几乎听不到任何噪音。其次，烘干效果是我最满意的一点。每次洗完衣服后，衣物都能保持干爽，不会有湿漉漉的感觉。此外，洗衣机的容量也很大，能满足家庭日常使用的需求。总的来说，这款小天鹅洗衣机在性能、设计和实用性上都表现出色，是一款值得推荐的产品。','https://misc.360buyimg.com/user/myjd-2015/css/i/peisong.jpg','j***a'),(10,4,'小天鹅滚筒洗衣机和热泵烘干机组合，真正实现了高效洗涤与烘干的完美结合，水魔方1.1洗净比提供了出色的清洁效果，能够有效去除衣物上的污渍，除菌除螨功能我们家的健康提供了有力保障，最喜欢动态柔烘功能，烘干后的衣物保持了如新衣一样的柔软度质感，非常好用。','https://misc.360buyimg.com/user/myjd-2015/css/i/peisong.jpg','当***可'),(11,4,'小天鹅并不是我的第一选择，后来朋友推荐国货之光品牌，洗烘分开的使用感更好，幸亏我听劝，1.1的洗净比，外观好看，安装师傅非常认真，蛮好的购物体验，我也推荐给朋友了','https://misc.360buyimg.com/user/myjd-2015/css/i/peisong.jpg','0***g'),(12,4,'小天鹅大品牌值得信赖👍👍👍声音非常小，比之前洗的干净多多了，烘干机把衣服里的绒毛杂质都烘出去了，跟新的一样👍 衣服蓬松柔软，买之前千挑万选真是没有买错😀','https://misc.360buyimg.com/user/myjd-2015/css/i/peisong.jpg','j***6'),(13,4,'外形外观：漂亮好看🤩\n洗净效果：非常好\n除菌效果：不错\n容量大小：够用\n小天鹅不错的选择 点赞👍','https://misc.360buyimg.com/user/myjd-2015/css/i/peisong.jpg','j***j'),(14,4,'小天鹅一直是我很喜欢的品牌，正好赶在这次家里装修采购了这个洗烘套装，到货安装后非常满意，安装师傅服务也非常到位，点赞。','https://misc.360buyimg.com/user/myjd-2015/css/i/peisong.jpg','唐***么'),(15,4,'店家服务态度非常好，并且安装的小哥非常给力，指导我们怎么安装，最主要的是真的很高大上，看起来很好看，我们还没有打柜子，有的话更好看','https://misc.360buyimg.com/user/myjd-2015/css/i/peisong.jpg','u***6'),(16,4,'洗净效果：很干净\n除菌效果：良好\n容量大小：容量10kg一家四口完全够用\n物流速度很快，服务也很好，会提前告知收货时间。','https://misc.360buyimg.com/user/myjd-2015/css/i/peisong.jpg','j***9'),(17,5,'美菱茶吧机收到，下单后，次日送达，物流很快很给力！款式新颖，设计巧妙，语音、触屏、遥控智能很方便快捷，六种模式，制冷加热保温功能齐全强大，加热壶底部加水，避免灰尘进入，壶里装有水位感应器防止溢水，外观简约大气，颜色款式跟室内装修风格很搭配，机身比一般茶吧机高一些，不用弯腰操作，机身钢化玻璃结实耐用，物超所值，值得信赖的品牌！','https://misc.360buyimg.com/user/myjd-2015/css/i/peisong.jpg','j***莲'),(18,5,'颜值很高 触屏灵敏 有遥控 可以远程控制接水热水等功能 两个出水口 保温效果也很不错 各种水温排水功能 用起来很顺手 女生也能独立安装','https://storage.360buyimg.com/i.imageUpload/6a645f3661373236663064333135653531353734303438393836313936_sma.jpg','鱼***迭'),(19,5,'货比三家取最优 因住在楼上 喝点水都不方便 后来在京东看到这款饮水机果断下单 真心推荐 有两个水壶 一个可以保温 喝茶也很方便 真的解决了我们喝水的问题 而且价格也不贵','https://misc.360buyimg.com/user/myjd-2015/css/i/peisong.jpg','k***4'),(20,5,'美菱，一直用美菱饮水机，这次又果断更换了美菱品牌的茶吧机，一直在使用，所以很信赖。到货后拆开箱子一看，就惊到我了，材质感觉，颜色搭配，做工品质，都让人觉得物有所值，加热壶和保温壶质量也不错，老婆和儿子都很喜欢，老妈也觉得好，给茶吧机点赞，给美菱点赞👍','https://storage.360buyimg.com/i.imageUpload/d5d7bfb5bfb5d5d731343838333535383430373232_sma.jpg','子***C'),(21,5,'京东物流真快、昨天买今天到，一直心心念的茶吧机终于到了。可以好好享受一下泡茶品茶的乐趣，遥控控制、解放双手，非常方便。烧水速度很快，解决饮水问题。','https://storage.360buyimg.com/i.imageUpload/6f6869737931343737383138363937373336_sma.jpg','C***s'),(22,5,'这款茶吧机真心不错!外观设计时尚大气，放在家里很显档次。操作起来也特别简单，各种功能一目了然，家里的老人小孩都能轻松使用。而且它的出水速度很快，水温也调控得刚刚好，泡出来的茶口感更加醇厚。最值得一提的是，它还具有自动保温功能，随时都能喝到热乎乎的茶水，真是太方便了!','https://storage.360buyimg.com/i.imageUpload/6a645f3534343233633730326431323431363534393939373430333733_sma.jpg','E***d'),(23,5,'茶吧机收到了，带语音的性价比特别高，这么低的价格，有这么高的品质，比水壶好太多了，外观也高大上，语音操作更加方便','https://storage.360buyimg.com/i.imageUpload/6a645f3662653233353137373539363231353237353530313833373739_sma.jpg','j***t'),(24,5,'茶吧机很棒。外观简约大气，放在家中很美观。取水方便快捷，加热速度快，能精准控制水温，无论是泡茶还是冲咖啡都能满足需求。使用起来安全又省心，性价比很高。','https://storage.360buyimg.com/i.imageUpload/6a645f3439663735626561636132623631343537393238373936343836_sma.jpg','沦***眸'),(25,5,'美菱茶吧机以其独特的语音控制功能给我留下了深刻的印象。在日常使用中，我发现语音控制的便捷性大大提升了我的操作效率，无需手动按键即可完成各项操作。同时，其造型设计简洁大方，不仅美观实用，还能很好地融入各种家居风格。性价比方面，这款茶吧机的价格与其功能和服务相比，具有很高的性价比。总的来说，美菱茶吧机是一款值得推荐的家用电器产品。','https://storage.360buyimg.com/i.imageUpload/616c6c737461727a796231363432313931333630373534_sma.jpg','奥***父'),(26,5,'外观很大气，颜色也很漂亮，实物美观大方，产品功能齐全，烧水方便快捷，抽水也很快，第二次购买了，产品很赞，是居家的好产品。👍👍','https://misc.360buyimg.com/user/myjd-2015/css/i/peisong.jpg','好***奇'),(27,7,'暖风机，暖风出的很快，一共三档，一档就够用了，我买的遥控器款的，躺在躺床就能直接控制，简单方便快捷控制，大小合适不占空间。','https://misc.360buyimg.com/user/myjd-2015/css/i/peisong.jpg','m***2'),(28,7,'外观设计：简约大方时尚\n取暖效果：虽然小巧，不过制暖效果很不错👍\n耗电情况：能耗表现很不错👍\n静音效果：几乎听不到声音\n安全设计：设计的安